import "./App.css";
import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Dashboard from "./components/dashboard";

class App extends React.PureComponent {
  render() {
    return (
        <BrowserRouter>
          <div className="m-20  ">
            <div className="border py-5 px-30 w-4/12 h-72 mx-auto">
              <Routes>
                <Route path="/" element={<Dashboard />} />
                <Route path="AddPost" element={<Dashboard />} />
              </Routes>
            </div>
          </div>
        </BrowserRouter>
    );
  }
}

export default App;
